import React from 'react';
import './Projects.css';

export default function FrontEndProj({idProject}) {
  return (
    <section className="projects-container">
     <h1>Testando</h1>
     <div className="project-front-end-card">
        <img alt="Luciano Lanes Lopes" className="project-pic"/>
        <div className="project-info">
          <p></p>
        </div>
        <div className="progress-bar">
          <p>soft skills</p>
          <hr className="skill-bar"/>
        </div>
      </div>
    </section>
  )
}
